import XCTest

fileprivate struct SampleData {
    static var opStationPositions: Data {
        return Data(base64Encoded: "")!
    }
    
    static var opLivePositions: Data {
        return Data(base64Encoded: "")!
    }
    
    static var dateFormatter: DateFormatter {
        let formatter = DateFormatter()
        formatter.dateFormat = "yyyy-MM-dd HH:mm:ss"
        formatter.timeZone = TimeZone(identifier: "UTC")
        
        return formatter
    }
}

class CSVDecoderTests: XCTestCase {
    override func setUp() {
        super.setUp()
    }
    
    func test_decode_opLivePositions() {
        let sut = try! CSVDecoder().decode(type: [OPLivePositions].self, from: SampleData.opLivePositions)
        
        XCTAssertTrue(sut.count == 815)
        XCTAssertEqual(sut[39].id, 40)
        XCTAssertEqual(sut[39].lat, 51.147785186767599)
        XCTAssertEqual(sut[39].long, 17.020614624023398)
        XCTAssertEqual(sut[39].line, "105")
        XCTAssertEqual(sut[39].plate, "DW2693U")
        XCTAssertEqual(sut[39].squad, "10503")
        XCTAssertEqual(sut[39].vehicle, 7030)
        XCTAssertEqual(sut[39].updateDate, SampleData.dateFormatter.date(from: "2018-02-11 15:56:50"))
    }
    
    func test_decode_semicolonDelimiter_opStationPositions() {
        let sut = try! CSVDecoder().decode(type: [OPStationPositions].self, from: SampleData.opStationPositions)
        
        XCTAssertTrue(sut.count == 1673)
        XCTAssertEqual(sut[1360].id, 11366)
        XCTAssertEqual(sut[1360].type, "3")
        XCTAssertEqual(sut[1360].long, 17.01500657)
        XCTAssertEqual(sut[1360].lat, 51.07431824)

    }

}
